import "./progress.css";
const ClientDetailTabBarProgress = () => {
  return (
    <div class="deal-view">
      <div class="stepper">
        <div class="stepper_item success green">
          <div class="stepper_title">New</div>
        </div>
        <div class="stepper_item success green">
          <div class="stepper_title">Discovery</div>
        </div>
        <div class="stepper_item pending green">
          <div class="stepper_title">Proposal</div>
        </div>
        <div class="stepper_item pending green">
          <div class="stepper_title">Negotiation</div>
        </div>
        <div class="stepper_item pending green">
          <div class="stepper_title">Closed</div>
        </div>
      </div>
    </div>
  );
};

export default ClientDetailTabBarProgress;
